import React from 'react';

const JobSearchList = () => (
  <>
    <h1> Various IT jobs </h1>
    <div>
      <Link to="/vacancies/Junior%20Tester/">Junior Tester</Link>
      <Link to="/vacancies/Lead%20Data%20Scientist">Lead Data Scientist</Link>
      <Link to="/vacancies/Junior%20Software%20Engineer">Junior Software Engineer</Link>
    </div>
  </>

);




export default JobSearchList;
